Actionscript.script:
hit = false;
_root.AreaTextClipF("Top of the Castle:"+newline+"<i>The Staircase</i>", 1);
_root.Starnamenum = 0;
onEnterFrame = function () {
	if ((_root.TotalStars<32 || _root.CurrentPlayer == "Luigi") && _root.CheatCastleUnlock == false) {
		if ((_root.Course.Char._x-_root.Course.BackGFX._x)>120) {
			if (hit == false) {
				_root.StartNewMusicAndIntroNoVar("EndlessStairs-Repeat");
			}
			hit = true;
		} else {
			if (hit == true) {
				_root.StartNewMusicAndIntroNoVar("InsidetheCastleWalls");
			}
			hit = false;
		}
		if (this.endlessbox.hitTest(_root.Course.Char.charClip.feet)) {
			_root.Course.Char._x -= 240;
			_root.Course.Char._y += 240;
			_root.MoveAllPlats(-240, 240);
		}
	}
};
stop();

onClipEvent (load) {
	_visible = false;
}
/*
onEnterFrame = function () {
_root.CamYchange = 35
};*/
onClipEvent (enterFrame) {
	if (this.hitTest(_root.Course.Char.charClip.body)) {
		if (_root.PauseGame == false && _root.playpause == false) {
			//_root.Course.Char.yspeed = _root.groundFriction(_root.Course.Char.yspeed, 0.015, 1.001);
			if (savezoom == undefined) {
				savezoom = _root.CameraZoom;
			}
			if (_root.CameraZoom<150) {
				_root.CameraZoom += 1;
			}
		}
	} else {
		if (savezoom !== undefined) {
			if (_root.CameraZoom>savezoom) {
				_root.CameraZoom -= 1;
			} else {
				savezoom = undefined;
			}
		}
	}
}

onClipEvent (load) {
	_visible = false;
	count = 0;
}
onClipEvent (enterFrame) {
	count++;
	// _root.Course.Char.attack == true && _root.Course.Char.attackFrame == "ExitPainting"
	if (count<3 && this.hitTest(_root.Course.Char.charClip.body)) {
		_root.Course.Char.charClip.frame.changemusic = false;
		_parent.inroom = true;
	}
}
